Manutenção Elétrica, Manutenção preventiva dos sistemas de: 

•	Bilhetagem: Realizar serviços de manutenção e instalação de torniquetes, postos de venda, nobreaks, quadros de alimentação e terminais de recarga; 
•	Telecomunicações: Realizar serviços de manutenção e instalação em fibra óptica, ramais, câmeras, monitores, CFTV, lançamento de cabos, cabeamento estruturado, sistema de comunicação por rádio (sistema Tetra), sonorização, switchs e sistemas de informação ao passageiro; 
•	Baixa Tensão Predial: Realizar Serviço de manutenção e instalação de quadros de tomadas (QT), quadro de iluminação (QL). 

Manutenção corretiva programada, emergencial e adequações – Baixa Tensão Predial: Realizar serviços de substituição e instalação de lâmpadas, reatores, luminárias, refletores, quadros de alimentação, tomadas, passagem de cabos (elétrica), serviços de adequação e montagens de infraestrutura elétricas. As atividades devem ser executadas conforme SLA estabelecido em contrato.
